    [],nt"num_tags": 6,nt"name": "back-bay-national-wildlife-refuge-annual-narrative-report-calendar-year-1981",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Back Bay
    National Wildlife Refuge, Fisherman Island National Wildlife Refuge, and Plum Tree
    National Wildlife Refuge outlines Refuge accomplishments during the 1981 calendar
    year. The report begins by summarizing the climate and habitat conditions during
    the year. The Refuge construction and maintenance section discusses physical developments.Wildlife-
    including migratory birds, raptors, and game animals- is also covered. A progress
    report on field investigations and applied research is also provided. The interpretation
    and recreation section of the report describes recreational uses. Items of interest,
    N-R forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
